export class Counter extends React.Component {
  constructor() {
    super();
    this.state = {
      count: 0
    };
  }

  render() {
    return (
      <div style={{ marginTop: "20px", marginLeft: "20px" }}>
        <h1>{this.contador}</h1>

        <div>
          <button>Diminuir</button>
          <button>Aumentar</button>
        </div>
      </div>
    );
  }
}
